-- title:  HELLO WORLD!
-- author: tic80
-- desc:   Hello World example
-- script: lua

t=0	-- time tic
x=96	-- sprite x position
y=24	-- sprite y position

function TIC()
	if btn(0) then y=y-1 end
	if btn(1) then y=y+1 end
	if btn(2) then x=x-1 end
	if btn(3) then x=x+1 end

	cls(13)
	spr(257+t%60//30*2,x,y,14,3,0,0,2,2)
	print("HELLO WORLD!",84,84)
	t=t+1
end

